import{_ as e,o as t,c as i,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 46.2-341.14:9 The skills test certificate; validity of results.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-341.14:9.md","filePath":"vacode/46.2-341.14:9.md"}'),r={name:"vacode/46.2-341.14:9.md"},s=a('<h1 id="§-46-2-341-14-9-the-skills-test-certificate-validity-of-results" tabindex="-1">§ 46.2-341.14:9 The skills test certificate; validity of results. <a class="header-anchor" href="#§-46-2-341-14-9-the-skills-test-certificate-validity-of-results" aria-label="Permalink to &quot;§ 46.2-341.14:9 The skills test certificate; validity of results.&quot;">​</a></h1><p>A. The Department will accept a skills test certificate issued in accordance with this section as satisfaction of the skills test component of the commercial driver&#39;s license examination.</p><p>B. Skills test certificates may be issued only to drivers who have passed the skills test conducted in accordance with this chapter and the instructions issued by the Department.</p><p>C. A skills test certificate will be accepted by the Department only if it is:</p><ol><li><p>Issued by a third party tester certified by the Department in accordance with this article;</p></li><li><p>In a format prescribed by the Department, completed in its entirety, without alteration; and</p></li><li><p>Signed by the third party examiner who conducted the skills test.</p></li></ol><p>D. The results of the skills test shall be valid for six months following the completion of the test.</p><p>2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0165" target="_blank" rel="noreferrer">165</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0582" target="_blank" rel="noreferrer">582</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0429" target="_blank" rel="noreferrer">429</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0060" target="_blank" rel="noreferrer">60</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0139" target="_blank" rel="noreferrer">139</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0292" target="_blank" rel="noreferrer">292</a>.</p>',7),l=[s];function c(n,o,h,p,f,d){return t(),i("div",null,l)}const u=e(r,[["render",c]]);export{g as __pageData,u as default};
